GENERAL TERMS AND CONDITIONS

26.	OPERATIONAL FLOW ORDERS

	26.1	In the event of force majeure or operating conditions that threaten the integrity of Pine Needle's liquefied natural gas storage facilities, it may be necessary for Pine Needle to issue Operational Flow Orders (OFOs) to effectuate vaporization and delivery of gas stored at such facilities.  Before issuing an OFO, Pine Needle will attempt to remedy those operating conditions through requests for voluntary action provided, however, exigent circumstances may exist which require immediate issuance of an OFO.  Accordingly, upon issuance of an OFO by Pine Needle to Customer, Customer shall adjust its gas receipts from Pine Needle as directed in the OFO.

	26.2	Any OFO by Pine Needle shall be given to Customer at least 24 hours in advance, unless exigent circumstances dictate otherwise.  Each OFO will contain the following provisions:

		(a)	Time and date of issuance;

		(b)	Time that the OFO is considered to be effective (if no time is specified, the OFO shall be effective immediately);

		(c)	Duration of the OFO (if none is specified, the OFO will be effective until further notice);

		(d)	A description of the event leading to the issuance of the OFO;

		(e)	The amount of gas required to be taken by Customer; and

		(f)	Any other terms Pine Needle may reasonably require to ensure effectiveness of the OFO.

	Pine Needle will publish all notices of implementation of an OFO and all provisions of an OFO on Pine Needle's EBB and provide notice either by e-mail or directly to Customer's Internet URL address, as expeditiously as possible.  Upon termination of an OFO, Pine Needle will post on Pine Needle's EBB relevant information specific to the individual situation regarding the issuance and lifting of that particular OFO as soon as it is available.

GENERAL TERMS AND CONDITIONS

17.	NOMINATIONS, CONFIRMATIONS AND ALLOCATION OF CAPACITY

	17.1	Nominations

		(a)	Customer shall notify or cause Pine Needle to be notified of Customer's receipt and delivery requirements under all firm and interruptible rate schedules in advance of such requirements.  All times specified in Section 17 are Central Clock Time (pursuant to NAESB WGQ Standard No. 0.3.17).  Pine Needle, in its sole judgment, may waive any nomination and ranking deadlines, on a non-discriminatory basis, if Pine Needle determines that operating conditions permit.  At a receipt or delivery point, the lesser of rule (pursuant to NAESB WGQ Standard No. 1.3.22) applies when confirming.  With respect to Customer's desired levels of service under firm and interruptible rate schedules, a nomination made through electronic data interchange shall include all mandatory Commission-approved data elements; for a nomination made through Pine Needle's EBB, Customer shall furnish Pine Needle the following:

			(i)	Customer's Contract and ID;	

			(ii)	The desired receipt and delivery points, the corresponding daily quantities, and the schedule ranks;

			(iii)	Names of entities who will deliver gas to Pine Needle and entities who will receive gas from Pine Needle; 

			(iv)	The downstream contract and entity who will receive gas from Pine Needle, if applicable;

			(v)	The begin and end dates upon which such deliveries are desired, provided the nomination begin and end dates are within the term of Customer's contract; and

			(vi)	Transaction Type.

			All nominations should be considered original nominations and should be replaced to be changed.  An original nomination shall apply to each cycle within the gas day unless the nomination is revised.  In that event, the revised nomination shall apply to subsequent cycles within the gas day.  Intraday nominations can be used to request increases or decreases in total flow, changes to receipt points, or changes to delivery points of scheduled gas.  When a nomination for a date range is received, each day within that range is considered an original nomination.  When a subsequent nomination is received for one or more days within that range, the previous nomination is superseded by the subsequent nomination only to the extent of the days specified.  The days of the previous nomination outside the range of the subsequent nomination are unaffected.  Nominations submitted during the Timely, Evening, ID1, ID2, and ID3 Cycles have a prospective effect only; nominations submitted during the Post Cycle and adjustments to prior gas days pursuant to Section 17.3 have a retroactive effect.

			All nominations for service must be made electronically through Pine Needle's EBB, by electronic data interchange, or by submitting a nomination through Transco that contains the path from the receipt/delivery on Transco to the corresponding delivery/receipt on Pine Needle; provided however, nominations submitted through Transco (i) must be in a form acceptable to Transco and Pine Needle and (ii) Transco and Pine Needle must be able to accommodate the interface.  

		(b)	Customer's nomination and schedule ranks, to be deemed timely, must conform to the following timeline (the Timely Nomination on the day prior to gas flow):

			1:00 p.m.	Electronic nomination leaves control of the Customer for nominations submitted by either Pine Needle's EBB or electronic data interchange;
			1:15 p.m.	Receipt of nomination by Pine Needle through electronic data interchange, including from Title Transfer Tracking Service Providers (TTTSPs);
			1:30 p.m.	Quick response by Pine Needle regarding validity of data elements of nominations received through electronic data interchange;
			4:30 p.m.	Receipt of completed confirmations by Pine Needle from upstream and  downstream connected operating entities;
			5:00 p.m.	Scheduled quantities made available by Pine Needle for receipt by Customer and point operator.

		(c)	Customer's nomination and schedule ranks for intraday cycles will conform to the following timelines.  For purposes of this section, "provide" shall mean, for transmittals pursuant to standards 1.4.x, receipt at the designated site, and for purposes of other forms of transmittal, it shall mean send or post.

			(i)	Pine Needle will accept nominations and schedule ranks for a Gas Day which are received after the Timely Nomination and ranking deadlines identified in Section 17.1(b) until 6:00 p.m. the day before gas flows (Evening Nomination).
				Evening Nomination Cycle:

				6:00 p.m.	Electronic nomination leaves control of the Customer for nominations submitted by either Pine Needle's EBB or electronic data interchange;
				6:15 p.m.	Receipt of nomination by Pine Needle through electronic data interchange, including from TTTSPs;
				6:30 p.m.	Quick response by Pine Needle regarding validity of data elements of nominations received through electronic data interchange;
				8:30 p.m.	Receipt of completed confirmations by Pine Needle from upstream and downstream connected operating entities;
				9:00 p.m.	Pine Needle to provide scheduled quantities to affected Customers and point operators, and provide scheduled quantities to bumped parties (notice to bumped parties).

					Scheduled quantities resulting from Evening Nominations shall be effective at the start of the next Gas Day.

			(ii)	Pine Needle will accept nominations and schedule ranks for a gas day which are received after the nomination and ranking deadlines identified in Section 17.1(b) and 17.1(c) until 10:00 a.m. of the affected Gas Day (Intraday 1 Nomination (ID1)).

				ID1 Cycle:
				10:00 a.m.	Electronic nomination leaves control of the Customer for nominations submitted by either Pine Needle's EBB or electronic data interchange;
				10:15 a.m.	Receipt of nomination by Pine Needle through electronic data interchange, including from TTTSPs;
				10:30 a.m.	Quick response by Pine Needle regarding validity of data elements of nominations received through electronic data interchange;
				12:30 p.m.	Receipt of completed confirmations by Pine Needle from upstream and downstream connected operating entities;
				1:00 p.m.	Pine Needle to provide scheduled quantities to affected Customers and point operators, and provide scheduled quantities to bumped parties (notice to bumped parties).

						Scheduled quantities resulting from ID1 shall be effective at 2:00 p.m. on the current Gas Day.

			(iii)	Pine Needle will accept nominations and schedule ranks for a gas day which are received after the nomination and ranking deadlines identified in Section 17.1(b), 17.1(c)(i), and 17.1(c)(ii) until 2:30 p.m. of the affected Gas Day (Intraday 2 Nomination (ID2)).

				ID2 Cycle:
				2:30 p.m.	Electronic nomination leaves control of the Customer for nominations submitted by either Pine Needle's EBB or electronic data interchange;
				2:45 p.m.	Receipt of nomination by Pine Needle through electronic data interchange, including from TTTSPs;
				3:00 p.m.	Quick response by Pine Needle regarding validity of data elements of nominations received through electronic data interchange;	
				5:00 p.m.	Receipt of completed confirmations by Pine Needle from upstream connected operating entities;	
				5:30 p.m.	Pine Needle to provide scheduled quantities to affected Customers and point operators, and provide scheduled quantities to bumped parties (notice to bumped parties).

						Scheduled quantities resulting from ID2 shall be effective at 6:00 p.m. on the current Gas Day.

			(iv)	Pine Needle will accept nominations and schedule ranks for a Gas Day which are received after the nomination and ranking deadlines identified in Section 17.1(b), 17.1(c)(i), 17.1(c)(ii), and 17.1(c)(iii) until 7:00 p.m. of the affected Gas Day (Intraday 3 Nomination (ID3)).

				ID3 Cycle:
				7:00 p.m.	Electronic nomination leaves control of the Consumer for nominations submitted by either Pine Needle's EBB or electronic data interchange;
				7:15 p.m.	Receipt of nomination by Pine Needle through electronic data interchange, including from TTTSPs;
				7:30 p.m.	Quick response by Pine Needle regarding validity of data elements of nominations received through electronic data interchange;
				9:30 p.m.	Receipt of completed confirmations by Pine Needle from upstream connected operating entities;
				10:00 p.m.	Pine Needle to provide scheduled quantities to affected Customers and point operators.

						Scheduled quantities resulting from ID3 shall be effective at 10:00 p.m. on Gas Day.  Bumping is not allowed during the ID3 Cycle.

		(d)	Pine Needle will accept nominations for a Gas Day which are received after the nomination deadlines identified in Section 17.1(c)(iv) until 10:00 a.m. the day following the gas flow (Post Cycle) provided that:

			(i)	Confirmation of the receipt and delivery quantities is received by Pine Needle from the affected point operators no later than 10:30 a.m. the day following the gas flow;

			(ii)	It is operationally feasible to accommodate the requested nomination; and

			(iii)	It is consistent with the tariff limitations applicable to such Gas Day.

Pine Needle will provide scheduled quantities to affected Customers and point operators by 11:30 a.m. Central Clock Time the day following the gas flow.  Scheduled quantities resulting from the Post Cycle are not subject to elapsed-prorated scheduled quantities and bumping is not allowed.

		(e)	Elapsed-prorated-scheduled quantity means that portion of the scheduled quantity that would have theoretically flowed up to the effective time of the Intraday Nomination being confirmed, based upon a cumulative uniform hourly quantity for each nomination period affected.  

			Elapsed-prorated-scheduled quantity will apply to all nomination decreases submitted in the ID1, ID2, and ID3 cycles.

		(f)	Pine Needle will publish all bumping notices on its EBB service as expeditiously as possible.

		(g)	For services that provide for intraday nominations and scheduling, there is no limitation as to the number of intraday nominations (line items as per NAESB WGQ Standard No. 1.2.1) which a service requester may submit at any one standard nomination cycle or in total across all standard nomination cycles.

	17.2	Confirmations

		An upstream or downstream operating entity's confirmation of nominations made pursuant to Section 17.1 herein, will be applied to subsequent cycles within the gas day unless the operating entity revises such confirmation.  In that event, any such revised confirmation will be applied to subsequent cycles within the gas day.

	17.3	Adjustments to Prior Gas Day Scheduled Quantities

Adjustments to prior gas day scheduled quantities after the Post Cycle deadline set forth in Section 17.1(d) will be permitted by Pine Needle in accordance with the following procedures and only if all parties affected by the resulting prior period reallocation (including Pine Needle) consent via 1Line or in writing to the adjustment; provided, however, Pine Needle shall not unreasonably withhold such consent.  All prior gas day requests must be operationally feasible and are subject to the tariff limitations applicable to such gas day.  All communication under this Section 17.3 must be made electronically consistent with Section 17.1(a) of the GT&C. 

a) For adjustments to prior gas day scheduled quantities for days in the current production month, Customer or the point operator must submit requests within 10 days after the close of the affected gas day or by the 2nd day of the following month, whichever is sooner. 

b) For adjustments to prior gas day scheduled quantities for days in a prior production month for which allocations are closed, Customer or the point operator must submit requests by the 25th day of a month.  Requests submitted more than 6 months from the date of the initial transportation invoice will be rejected.

Pine Needle will notify all parties affected by a Customer's or point operator's request for an adjustment to prior gas day scheduled quantities.  All affected parties (including Pine Needle) must indicate their consent within 5 days of the later of (1) the date of Customer's or point operator's request, or (2) the date of the most recent consent submitted by an affected party and received by Pine Needle; provided however, all consents must be received by Pine Needle before the date that allocations close for the accounting month.  If all affected parties' consents are not received by Pine Needle in accordance with these provisions, Customer's or point operator's request will expire.  Customers or point operators may re-submit previously expired requests if the request is submitted within 6 months from the date of the initial transportation invoice.

Adjustments to prior gas day scheduled quantities are not subject to elapsed-pro-rated scheduled quantities and bumping is not allowed.

Pine Needle, in its sole judgment, may waive any deadlines established herein, on a non-discriminatory basis, if Pine Needle determines that operating conditions permit.

	17.4	Allocation of Capacity

		In reaching its determination of capacity which Pine Needle anticipates that it will have available to satisfy Customers' requests for services each day, Pine Needle will give first priority to Customers under Rate Schedule LNG-1.  In the event quantities scheduled under Section 6.3 of Rate Schedule LNG-1 exceed Pine Needle's truck loading capability for any day, Pine Needle shall order reduction of Customer's firm truck loading entitlements on a pro rata basis based on the firm contract storage entitlements of the Customers scheduling such withdrawals.  To the extent capacity remains, it shall be allocated to Customers' interruptible services under Rate Schedule LNG-2 on a first-come, first-served basis.
